ritannica.com\\/science\\/electric-current\\\">current<\\/a> passing through the primary <a href=\\\"https:\\/\\/www.britannica.com\\/technology\\/induction-coil\\\">coil<\\/a>, current is induced in another coil, called the secondary. The secondary voltage is calculated by multiplying the primary voltage by the ratio of the number of turns in the secondary coil to the number of turns in the primary coil, a quantity called the turns ratio.<\\/p>\",\"quantity\":\"50\",\"status\":\"on\",\"_token\":\"4fpzhy61c5GM5kvkrnPCR8sW05l4X7ErFxfC0uwF\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/products\"}','2023-01-09 17:03:50','2023-01-09 17:03:50'),(2357,1,'admin/products','GET','127.0.0.1','[]','2023-01-09 17:03:53','2023-01-09 17:03:53'),(2358,1,'admin/products/create','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:05:39','2023-01-09 17:05:39'),(2359,1,'admin/products','POST','127.0.0.1','{\"name\":\"HT Panel\",\"type\":\"Swithgear\",\"description\":\"<p>Switchgear is <strong>a broad term that describes a wide variety of switching devices that all fulfill a common need: controlling, protecting, and isolating power systems<\\/strong>. This definition can be extended to include devices to regulate and meter a power system, circuit breakers, and similar technology.<\\/p>\",\"quantity\":\"30\",\"status\":\"on\",\"_token\":\"4fpzhy61c5GM5kvkrnPCR8sW05l4X7ErFxfC0uwF\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/products\"}','2023-01-09 17:06:52','2023-01-09 17:06:52'),(2360,1,'admin/products','GET','127.0.0.1','[]','2023-01-09 17:06:55','2023-01-09 17:06:55'),(2361,1,'admin/products/create','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:06:59','2023-01-09 17:06:59'),(2362,1,'admin/products','POST','127.0.0.1','{\"name\":\"LT Panel\",\"type\":\"Swithgear\",\"description\":\"<p>In industries and domestic&rsquo;s applications, various electrical and electronics devices and distribution boards such panels use. Low Terminal pa