/services\"}','2023-01-09 17:37:31','2023-01-09 17:37:31'),(2395,1,'admin/services','GET','127.0.0.1','[]','2023-01-09 17:37:32','2023-01-09 17:37:32'),(2396,1,'admin/services/create','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:37:34','2023-01-09 17:37:34'),(2397,1,'admin/services','POST','127.0.0.1','{\"name\":\"Generators\",\"description\":\"<p>In <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Electricity_generation\\\">electricity generation<\\/a>, a <strong>generator<\\/strong><a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Electric_generator#cite_note-1\\\">[1]<\\/a> is a device that converts motive power (<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Mechanical_energy\\\">mechanical energy<\\/a>) or fuel-based power (<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Chemical_energy\\\">chemical energy<\\/a>) into <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Electric_power\\\">electric power<\\/a> for use in an external <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Electrical_circuit\\\">circuit<\\/a>. Sources of mechanical energy include <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Steam_turbine\\\">steam turbines<\\/a>, <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Gas_turbine\\\">gas turbines<\\/a>, <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Water_turbine\\\">water turbines<\\/a>, <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Internal_combustion_engine\\\">internal combustion engines<\\/a>, <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Wind_turbine\\\">wind turbines<\\/a> and even hand <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Crank_(mechanism)\\\">cranks<\\/a>. The first electromagnetic generator, the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Faraday_disk\\\">Faraday disk<\\/a>, was invented in 1831 by British scientist <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Michael_Faraday\\\">Michael Faraday<\\/a>. Generators provide nearly all of the power for <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Electric_power_grid\\\">electric power grids<\\/a>.<\\/p>\",\"status\":\"on\",\"_token\":\"4fpzhy61c5GM5kvkrnPCR8sW05l4X7ErFxfC0uwF\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/services\"}','2023-01-09 17:38:19','2023-01-09 17:38:19'),(2398,1,'admin/services','GET','127.0.0.1','[]','2023-01-09 17:38:19','2023-01-09 17:38:19'),(2399,1,'admin/services/14/edit','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:38:26','2023-01-09 17:38:26'),(2400,1,'admin/services/14','PUT','127.0.0.1','{\"name\":\"Generators\",\"description\":\"<p>In <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Electricity_generation\\\">electricity generation<\\/a>, a <strong>generator<\\/strong><a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Electric_generator#cite_note-1\\\">[1]<\\/a> is a device that converts motive power (<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Mechanical_energy\\\">mechanical energy<\\/a>) or fuel-based power (<a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Chemical_energy\\\">chemical energy<\\/a>) into <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Electric_power\\\">electric power<\\/a> for use in an external <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Electrical_circuit\\\">circuit<\\/a>. Sources of mechanical energy include <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Steam_turbine\\\">steam turbines<\\/a>, <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Gas_turbine\\\">gas turbines<\\/a>, <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Water_turbine\\\">water turbines<\\/a>, <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Internal_combustion_engine\\\">internal combustion engines<\\/a>, <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Wind_turbine\\\">wind turbines<\\/a> and even hand <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Crank_(mechanism)\\\">cranks<\\/a>. The first electromagnetic generator, the <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Faraday_disk\\\">Faraday disk<\\/a>, was invented in 1831 by British scientist <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Michael_Faraday\\\">Michael Faraday<\\/a>. Generators provide nearly all of the power for <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Electric_power_grid\\\">electric power grids<\\/a>.<\\/p>\",\"status\":\"on\",\"_token\":\"4fpzhy61c5GM5kvkrnPCR8sW05l4X7ErFxfC0uwF\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/services\"}','2023-01-09 17:38:41','2023-01-09 17:38:41'),(2401,1,'admin/services','GET','127.0.0.1','[]','2023-01-09 17:38:42','2023-01-09 17:38:42'),(2402,1,'admin/services/12/edit','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:39:35','2023-01-09 17:39:35'),(2403,1,'admin/services/12','PUT','127.0.0.1','{\"name\":\"Substation Work\",\"description\":\"<p>A <strong>substation<\\/strong> is a part of an electrical <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Electricity_generation\\\">generation<\\/a>, <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Electric_power_transmission\\\">transmission<\\/a>, and <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Electric_power_distribution\\\">distribution<\\/a> system. Substations transform <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Voltage\\\">voltage<\\/a> from high to low, or the reverse, or perform any of several other important functions. Between the generating station and consumer, electric power may flow through several substations at different voltage levels. A substation may include <a href=\\\"https:\\/\\/en.wikipedia.org\\/wiki\\/Transformer\\\">transformers<\\/a> to change voltage levels between high transmission voltages and lower distribution voltages, or at the interconnection of two different transmission voltages. They are a common component of the infrastructure, for instance there are 55,000 substations in the United States.<\\/p>\",\"status\":\"on\",\"_token\":\"4fpzhy61c5GM5kvkrnPCR8sW05l4X7ErFxfC0uwF\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/services\"}','2023-01-09 17:40:26','2023-01-09 17:40:26'),(2404,1,'admin/services','GET','127.0.0.1','[]','2023-01-09 17:40:27','2023-01-09 17:40:27'),(2405,1,'admin/services/13/edit','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:40:46','2023-01-09 17:40:46'),(2406,1,'admin/services/13','PUT','127.0.0.1','{\"name\":\"Switchgear Panels\",\"description\":\"<p>Circuits are designed to handle a limited amount of electricity, and when too much current passes through, it can cause the wiring to overheat. This may damage vital electrical components, or even lead to fires. Switchgears are designed to defend equipment connected to a power supply from the threat of electrical overload.<\\/p>\",\"status\":\"on\",\"_token\":\"4fpzhy61c5GM5kvkrnPCR8sW05l4X7ErFxfC0uwF\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/services\"}','2023-01-09 17:40:55','2023-01-09 17:40:55'),(2407,1,'admin/services','GET','127.0.0.1','[]','2023-01-09 17:40:56','2023-01-09 17:40:56'),(2408,1,'admin/services/14/edit','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:41:12','2023-01-09 17:41:12'),(2409,1,'admin/services/14','PUT','127.0.0.1','{\"name\":\"Generators\",\"description\":\"<p>Generators are useful appliances that supply electrical power during a power outage and prevent discontinuity of daily activities or disruption of business operations. Generators are available in different electrical and physical configurations for use in different applications. In the following sections, we will look at how a generator functions, the main components of a generator, and how a generator operates as a secondary source of electrical power in residential and industrial applications.<\\/p>\",\"status\":\"on\",\"_token\":\"4fpzhy61c5GM5kvkrnPCR8sW05l4X7ErFxfC0uwF\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/services\"}','2023-01-09 17:42:16','2023-01-09 17:42:16'),(2410,1,'admin/services','GET','127.0.0.1','[]','2023-01-09 17:42:17','2023-01-09 17:42:17'),(2411,1,'admin/product_category','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:53:01','2023-01-09 17:53:01'),(2412,1,'admin/product_category/create','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:53:03','2023-01-09 17:53:03'),(2413,1,'admin/product_category','POST','127.0.0.1','{\"category_name\":\"Testing Equipments\",\"status\":\"on\",\"_token\":\"4fpzhy61c5GM5kvkrnPCR8sW05l4X7ErFxfC0uwF\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/product_category\"}','2023-01-09 17:53:06','2023-01-09 17:53:06'),(2414,1,'admin/product_category','GET','127.0.0.1','[]','2023-01-09 17:53:07','2023-01-09 17:53:07'),(2415,1,'admin/products','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:53:10','2023-01-09 17:53:10'),(2416,1,'admin/products/59/edit','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:53:21','2023-01-09 17:53:21'),(2417,1,'admin/products/59','PUT','127.0.0.1','{\"name\":\"Transformer OIl Centrifuse Machine\",\"type\":\"Testing Equipments\",\"description\":\"<p>Transformer oil centrifuging is all together a different technology and has a little impact on improving the oil parameters. Centrifuges used for separation of dirt from the transformer oil can be <strong>slow speed type centrifuges that do not require additional electric motor to spin the centrifuge cone at high speed<\\/strong>.<\\/p>\",\"quantity\":\"100\",\"status\":\"on\",\"_token\":\"4fpzhy61c5GM5kvkrnPCR8sW05l4X7ErFxfC0uwF\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/products\"}','2023-01-09 17:53:29','2023-01-09 17:53:29'),(2418,1,'admin/products','GET','127.0.0.1','[]','2023-01-09 17:53:30','2023-01-09 17:53:30'),(2419,1,'admin/products/60/edit','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:53:36','2023-01-09 17:53:36'),(2420,1,'admin/products/60','PUT','127.0.0.1','{\"name\":\"Transformer Testing Equipment\",\"type\":\"Testing Equipments\",\"description\":\"<p>DV Power test instruments perform various diagnostic tests on power and instrument transformers. Even more, a unique feature is a condition assessment of on-load tap changers. Performing a transformer test before their breakage can be crucial.<\\/p>\",\"quantity\":\"25\",\"status\":\"on\",\"_token\":\"4fpzhy61c5GM5kvkrnPCR8sW05l4X7ErFxfC0uwF\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/products\"}','2023-01-09 17:53:44','2023-01-09 17:53:44'),(2421,1,'admin/products','GET','127.0.0.1','[]','2023-01-09 17:53:45','2023-01-09 17:53:45'),(2422,1,'admin/products/create','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:53:53','2023-01-09 17:53:53'),(2423,1,'admin/products','POST','127.0.0.1','{\"name\":\"Panel Testing\",\"type\":\"Testing Equipments\",\"description\":\"<p>The electrical panels, widely used in all kind of substations and industrial applications, integrates all the secondary devices, such as the measurement elements, control switches, signaling and secondary protections (overcurrent, distance, voltage relays, etc). The electrical panel test in any power system is made to ensure that the panel construction, connection and performance is correct from the operational, reliability and safety viewpoint; hence, to ensure the continuity of electrical operation, a comprehensive panel test is carried out in factory, in commissioning and during maintenance programs, with many different inspection, quality and panel test procedures.<\\/p>\",\"quantity\":\"30\",\"status\":\"on\",\"_token\":\"4fpzhy61c5GM5kvkrnPCR8sW05l4X7ErFxfC0uwF\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/products\"}','2023-01-09 17:55:18','2023-01-09 17:55:18'),(2424,1,'admin/products','GET','127.0.0.1','[]','2023-01-09 17:55:19','2023-01-09 17:55:19'),(2425,1,'admin/products/create','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:57:09','2023-01-09 17:57:09'),(2426,1,'admin/products','POST','127.0.0.1','{\"name\":\"Transformer Centrifuging Machine\",\"type\":\"Testing Equipments\",\"description\":\"<p>This is a portable system for transformer oil cleaning and filtration, based on centrifuge technology. It is a 100% consumables free filtration system. The system houses as standard equipment, mainly gear, pump, motor, starter, several sensing and indicating equipments and centrifuge.<\\/p>\",\"quantity\":\"30\",\"status\":\"on\",\"_token\":\"4fpzhy61c5GM5kvkrnPCR8sW05l4X7ErFxfC0uwF\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/products\"}','2023-01-09 17:58:36','2023-01-09 17:58:36'),(2427,1,'admin/products','GET','127.0.0.1','[]','2023-01-09 17:58:37','2023-01-09 17:58:37'),(2428,1,'admin/products/59/edit','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 17:59:08','2023-01-09 17:59:08'),(2429,1,'admin/products/59','PUT','127.0.0.1','{\"name\":\"Oil Testing Equipment\",\"type\":\"Testing Equipments\",\"description\":\"<p>Transformer oil centrifuging is all together a different technology and has a little impact on improving the oil parameters. Centrifuges used for separation of dirt from the transformer oil can be <strong>slow speed type centrifuges that do not require additional electric motor to spin the centrifuge cone at high speed<\\/strong>.<\\/p>\",\"quantity\":\"100\",\"status\":\"on\",\"_token\":\"4fpzhy61c5GM5kvkrnPCR8sW05l4X7ErFxfC0uwF\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/127.0.0.1:8000\\/admin\\/products\"}','2023-01-09 17:59:24','2023-01-09 17:59:24'),(2430,1,'admin/products','GET','127.0.0.1','[]','2023-01-09 17:59:24','2023-01-09 17:59:24'),(2431,1,'admin/acheivements','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 18:12:10','2023-01-09 18:12:10'),(2432,1,'admin/acheivements/3/edit','GET','127.0.0.1','{\"_pjax\":\"#pjax-container\"}','2023-01-09 18:12:15','2023-01-09 18:12:15'),(2433,1,'admin/acheivements/3','PUT','127.0.0.1','{\"