/*Data for the table `faq` */

insert  into `faq`(`id`,`question`,`answer`,`status`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (1,'What is Power Station?','<p>A <strong>power station</strong>, also referred to as a <strong>power plant</strong> and sometimes <strong>generating station</strong> or <strong>generating plant</strong>, is an industrial facility for the <a href=\"https://en.wikipedia.org/wiki/Electricity_generation\">generation</a> of <a href=\"https://en.wikipedia.org/wiki/Electric_power\">electric power</a>. Power stations are generally connected to an <a href=\"https://en.wikipedia.org/wiki/Electrical_grid\">electrical grid</a>.</p>',1,NULL,1,'2022-12-22 14:39:20','2022-12-24 07:06:44'),(2,'What is Electric Lift?','<p>What is electric lifts? For electric lifts we mean those that are operated by a winch, which has the task of transmitting the motion to the cabin through the adherence of the ropes and served by a motor which must necessarily be positioned on the top of the shaft.</p>',1,NULL,1,'2022-12-22 14:39:36','2022-12-24 07:07:27');

