/*Data for the table `job_circular` */

insert  into `job_circular`(`id`,`post_name`,`contaxt`,`responsibility`,`nature`,`requirment_education`,`requirment_experience`,`salary`,`benefits`,`status`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (1,'Software Engineer','<p>We are looking for <strong>Software Engineer</strong>/ Senior <strong>Software Engineer</strong> with skills and experience in building modern web applications using the back end (PHP Laravel framework), front end (css, JQuery, JavaScript, Vue.js, ReactJS etc.) technologies.</p>','<ul>\r\n	<li>Design and develop client-side and server-side architecture for web and mobile applications.</li>\r\n	<li>Design and develop effective APIs.</li>\r\n	<li>Design, develop and manage well-functioning databases.</li>\r\n	<li>Design, develop and integrate cross platform mobile application.</li>\r\n	<li>Design, develop and integrate mobile responsive web application.</li>\r\n	<li>Write clean, secure, test-driven, easily maintainable, and modular codes as well as coach the team to do the same.</li>\r\n	<li>Optimize web applications for maximum speed and scalability.</li>\r\n	<li>Unit Test, troubleshoot, debug and monitor activities to ensure or improve responsiveness and efficiency on all projects</li>\r\n	<li>Work closely with project manager or stakeholders to ideate software solutions.</li>\r\n	<li>Create technical documentation or provide support on relevant reports/documents.</li>\r\n</ul>','<p>Full-time</p>','<ul>\r\n	<li>Bachelor of Computer Application (BCA) in Computer Science, Bachelor in Engineering (BEngg) in EEE</li>\r\n	<li>Skills Required: API Development, JavaScript, PHP Laravel, ReactJS, VueJS</li>\r\n</ul>','<ul>\r\n	<li>At least 2 year(s)</li>\r\n	<li>The applicants should have experience in the following area(s):<br />\r\n	AngularJS, API Development, JavaScript, JS JQuery AJAX, MySQL database, PHP Laravel, ReactJS, VueJS</li>\r\n	<li>The applicants should have experience in the following business area(s):<br />\r\n	Software Company</li>\r\n</ul>','Tk. 35000 - 60000 (Monthly)','<ul>\r\n	<li>Salary Review: Yearly</li>\r\n	<li>Tax will be paid by Company</li>\r\n	<li>No extra bonuses; All bonuses are included in monthly Salary</li>\r\n	<li>Learning Opportunity</li>\r\n</ul>',1,NULL,1,'2022-12-11 17:09:37','2022-12-24 15:54:37'),(2,'Marketing Executive','<ul>\r\n	<li>Job Location: Dhaka (Mohakhali DOHS)</li>\r\n	<li>Position : Both Male and Female</li>\r\n</ul>','<ul>\r\n	<li>Sales &amp; Marketing proficiency for Interior Company &amp; Interior related Products.</li>\r\n	<li>Article writing, Blog writing, Image editing, Photoshop-Illustrator basic skills, Social Media Management like (Facebook, Instagram, Youtube channel, twitter etc)</li>\r\n	<li>Creative content creation knowledge.</li>\r\n	<li>Expert in tele communication &amp; customer service.</li>\r\n	<li>Male &amp; Female candidate will work as a team. Male candidate will involve in field marketing &amp; Female candidate will follow up those marketing data from office.</li>\r\n	<li>Both candidate&#39;s work will monthly target based. Able solve target oriented task.</li>\r\n	<li>If needed both candidate will attend client meeting &amp; visit site.</li>\r\n	<li>The Male Candidate must know bike riding &amp; have own driving license. Those who has his own bike, will get preference.</li>\r\n	<li>Computer typing speed - at least 30 words per minute (English). Using of Avro for Bangla.</li>\r\n	<li>Presentable and smart/confidently speaking candidates will get preference.</li>\r\n	<li>Must have good Bangla &amp; English writing ability about any kind of Product.</li>\r\n	<li>Quick communication &amp; problem-solving ability.</li>\r\n</ul>','<ul>\r\n	<li>Full-time</li>\r\n	<li>Work at office</li>\r\n</ul>','<ul>\r\n	<li>Bachelor degree in any discipline, Bachelor of Business Administration (BBA), Diploma in Civil, Diploma in Engineering in Electrical &amp; Electronic Engineering</li>\r\n	<li>Digital Marketing, Bachelor degree in any discipline.</li>\r\n	<li>Master&#39;s degree in any discipline.</li>\r\n</ul>','<ul>\r\n	<li>At most 2 year(s)</li>\r\n	<li>Freshers are also encouraged to apply.</li>\r\n	<li>Age 25 to 32 years</li>\r\n	<li>Both males and females are allowed to apply</li>\r\n	<li>The applicants should have experience in the following business area(s):</li>\r\n	<li>Creative Content Creation, Sales &amp; Marketing of Interior, Customer Service, Digital Platform Management &amp; Communication</li>\r\n</ul>','Tk. 15000 - 20000 (Monthly)     Depends on skill','<ul>\r\n	<li>T/A, Mobile bill</li>\r\n	<li>Salary Review: Yearly</li>\r\n	<li>Festival Bonus: 2</li>\r\n	<li>Lunch Facilities: No</li>\r\n	<li>Fuel cost for Bike.</li>\r\n	<li>Other facilities which are given to other employees from the Company.</li>\r\n</ul>',1,1,NULL,'2023-01-15 02:47:08','2023-01-15 02:47:08');

