insert  into `products`(`id`,`type`,`name`,`description`,`quantity`,`image`,`status`,`created_by`,`updated_by`,`created_at`,`updated_at`,`image_1`,`image_2`,`image_3`,`image_4`) values (53,'Transformers','Transformer','<p>Transformers change voltage through <a href=\"https://www.britannica.com/science/electromagnetic-induction\">electromagnetic induction</a>; i.e., as the magnetic lines of force (flux lines) build up and collapse with the changes in <a href=\"https://www.britannica.com/science/electric-current\">current</a> passing through the primary <a href=\"https://www.britannica.com/technology/induction-coil\">coil</a>, current is induced in another coil, called the secondary. The secondary voltage is calculate',50,'images/4-1.JPG',1,1,NULL,'2023-01-09 17:03:50','2023-01-09 17:03:50','images/bbd610518228403cf95fd2780a83cdd9.jpg','images/20160114_133803.jpg','images/new44.jpeg','images/a0ff2e996946d402162da5ccc9f1cc44.jpg'),(54,'Swithgear','HT Panel','<p>Switchgear is <strong>a broad term that describes a wide variety of switching devices that all fulfill a common need: controlling, protecting, and isolating power systems</strong>. This definition can be extended to include devices to regulate and meter a power system, circuit breakers, and similar technology.</p>',30,'images/384cd174998c7d74b47cac7a5d77a710.jpeg',1,1,NULL,'2023-01-09 17:06:52','2023-01-09 17:06:52','images/37f89c26dedde211bd4159c773439069.jpg','images/9aaadf09c8b55aca767ddf96a458df68.jpeg','images/cab355c73af118c79f3ef08e234a59ac.jpeg',NULL),(55,'Swithgear','LT Panel','<p>In industries and domestic&rsquo;s applications, various electrical and electronics devices and distribution boards such panels use. Low Terminal panels receive power from a generator or transformer and distributor. It is also a kind of electrical distribution board. To provide luxury living for the human, in the continuity of the electrical supply for the load appliances like fans, motors, etc. LT Panel plays a critical role in industry and factory.</p>',20,'images/347d7bf333eea4899b973108e1e7d823.jpg',1,1,NULL,'2023-01-09 17:12:47','2023-01-09 17:12:47','images/b1e420cef07a0cb71296480e8fd7dd1f.jpg','images/5f43ed2ba730c984d4b3c1d805c34432.jpeg','images/873093a433ddb91dbb9735b78112f2c6.jpeg','images/a21a039103f5c481d81457e9064baad0.jpeg'),(56,'Swithgear','PFI Panel','<p>Power Factor of the system is degraded due to inductive load of different industries and big apartments. Power-Sonic manufactures PFI (Power Factor Improvement) Plant for improving the degraded Power Factor of the system.</p>',20,'images/9444b6311ce4c9ea60e8f196e8395a7a.jpg',1,1,NULL,'2023-01-09 17:14:10','2023-01-09 17:14:10','images/20191006_104542.jpg','images/130eb792bda2cac99d47e8a20fcb5da1.jpg','images/new31.jpeg','images/6ba1cb76316437abb0043a6a1fe120f9.jpeg'),(57,'BBT','BBT','<p>Your <strong>basal body temperature</strong> is your temperature when you&#39;re fully at rest. Ovulation may cause a slight increase in basal body temperature. You&#39;ll be most fertile during the two to three days before your temperature rises.</p>',15,'images/10c7a03af1864220bc620388d37041f6.jpg',1,1,NULL,'2023-01-09 17:17:23','2023-01-09 17:17:23','images/49e5f344d111b5c931611f01141aad10.jpg','images/3.png','images/BBT.jpeg','images/Untitled.jpg'),(58,'Generator','Generator','<p>In <a href=\"https://en.wikipedia.org/wiki/Electricity_generation\">electricity generation</a>, a <strong>generator</strong><a href=\"https://en.wikipedia.org/wiki/Electric_generator#cite_note-1\">[1]</a> is a device that converts motive power (<a href=\"https://en.wikipedia.org/wiki/Mechanical_energy\">mechanical energy</a>) or fuel-based power (<a href=\"https://en.wikipedia.org/wiki/Chemical_energy\">chemical energy</a>) into <a href=\"https://en.wikipedia.org/wiki/Electric_power\">electric power</a',30,'images/6.jpg',1,1,NULL,'2023-01-09 17:18:31','2023-01-09 17:18:31','images/de24ee34b4b070282b0c225f9e72d46d.JPG','images/6-2.JPG','images/10603466_950193865068413_6200006123900024822_n.jpg','images/12465863_950193848401748_1802722082212353960_o.jpg'),(59,'Testing Equipments','Oil Testing Equipment','<p>Transformer oil centrifuging is all together a different technology and has a little impact on improving the oil parameters. Centrifuges used for separation of dirt from the transformer oil can be <strong>slow speed type centrifuges that do not require additional electric motor to spin the centrifuge cone at high speed</strong>.</p>',100,'images/38441cdde70b56b108f093e1e9f54044.jpeg',1,1,1,'2023-01-09 17:25:50','2023-01-09 18:35:17','images/new3.jpeg',NULL,NULL,NULL),(60,'Testing Equipments','Transformer Testing Equipment','<p>DV Power test instruments perform various diagnostic tests on power and instrument transformers. Even more, a unique feature is a condition assessment of on-load tap changers. Performing a transformer test before their breakage can be crucial.</p>',25,'images/new7.jpeg',1,1,1,'2023-01-09 17:27:10','2023-01-09 17:53:44','images/new8.jpeg',NULL,NULL,NULL),(61,'Testing Equipments','Panel Testing','<p>The electrical panels, widely used in all kind of substations and industrial applications, integrates all the secondary devices, such as the measurement elements, control switches, signaling and secondary protections (overcurrent, distance, voltage relays, etc). The electrical panel test in any power system is made to ensure that the panel construction, connection and performance is correct from the operational, reliability and safety viewpoint; hence, to ensure the continuity of electrical o',30,'images/a0e06b71894b3b4906a35709aca1c705.jpeg',1,1,NULL,'2023-01-09 17:55:18','2023-01-09 17:55:18','images/b4108dc3bbab2769e7e050cc64c9f139.jpeg',NULL,NULL,NULL),(62,'Testing Equipments','Transformer Centrifuging Machine','<p>This is a portable system for transformer oil cleaning and filtration, based on centrifuge technology. It is a 100% consumables free filtration system. The system houses as standard equipment, mainly gear, pump, motor, starter, several sensing and indicating equipments and centrifuge.</p>',30,'images/128afa824d9a6934d6304c3c1579a97a.jpeg',1,1,1,'2023-01-09 17:58:36','2023-01-09 18:34:26','images/9d03b83bdfedcb425fc0484d758f9d12.jpeg',NULL,NULL,NULL);

