insert  into `services`(`id`,`name`,`description`,`image`,`status`,`created_by`,`updated_by`,`created_at`,`updated_at`) values (12,'Substation Work','<p>A <strong>substation</strong> is a part of an electrical <a href=\"https://en.wikipedia.org/wiki/Electricity_generation\">generation</a>, <a href=\"https://en.wikipedia.org/wiki/Electric_power_transmission\">transmission</a>, and <a href=\"https://en.wikipedia.org/wiki/Electric_power_distribution\">distribution</a> system. Substations transform <a href=\"https://en.wikipedia.org/wiki/Voltage\">voltage</a> from high to low, or the reverse, or perform any of several other important functions. Between t','images/7a086e617eb86274b43eca0669f75db9.jpg',1,1,1,'2023-01-09 17:35:05','2023-01-09 17:40:26'),(13,'Switchgear Panels','<p>Circuits are designed to handle a limited amount of electricity, and when too much current passes through, it can cause the wiring to overheat. This may damage vital electrical components, or even lead to fires. Switchgears are designed to defend equipment connected to a power supply from the threat of electrical overload.</p>','images/6335cfc5e7b616f3cbc739c83a31b23d.jpeg',1,1,1,'2023-01-09 17:37:31','2023-01-09 17:40:56'),(14,'Generators','<p>Generators are useful appliances that supply electrical power during a power outage and prevent discontinuity of daily activities or disruption of business operations. Generators are available in different electrical and physical configurations for use in different applications. In the following sections, we will look at how a generator functions, the main components of a generator, and how a generator operates as a secondary source of electrical power in residential and industrial applicatio','images/7284df5bc3a6c4295db37f837ef3fb4f.jpg',1,1,1,'2023-01-09 17:38:19','2023-01-09 17:42:16');

